import { useSelector } from "react-redux";

const CartList = () => {
  const cartList = useSelector((state) => state.cart.cartList);

  return (
    <>
      <div>
        <h2>Shopping Cart</h2>
        <div>
          <table>
            <thead>
              <th>Image</th>
              <th>Product</th>
              <th>Price</th>
              <th>Quantity</th>
              <th>Total</th>
              <th>Remove</th>
            </thead>
            {cartList &&
              cartList.map((cartItem) => {
                <cartItem
                  key={cartItem.product["_id"]["$oid"]}
                  cart={cartItem}
                />;
              })}
          </table>
        </div>
      </div>
    </>
  );
};

export default CartList;
